import React from 'react';
import { BsTools } from 'react-icons/bs';
import {
  Container,
  Content,
  BackgroundIMG,
  AnimationContainer,
} from './styles';

const SignIn: React.FC = () => {
  return (
    <Container>
      <Content>
        <AnimationContainer>
          <h1>Tool Control</h1>
          <BsTools size={55} />
          <form action="" />
        </AnimationContainer>
      </Content>
      <BackgroundIMG />
    </Container>
  );
};

export default SignIn;
